import React from 'react';

function PopulateCharacters(props){
    console.log(props.currentUser.characters);

    // return null;

     return props.currentUser.characters.forEach(character => {
        console.log(`Character Name: ${character.name}`);
        console.log(`Character Level: ${character.level}`);
        console.log(`Character Physique: ${character.physique}`);
        console.log(`Character Current Experience: ${character.current_experience}`);

        return(
            <div className={`${character.name}`}>
                <h1>{character.name}</h1>
                <h2>{character.level}</h2>
                <p>{character.physique}</p>
                <p>{character.current_experience}</p>
            </div>
        )
    })

}

export default PopulateCharacters;
